  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="w-100 d-flex flex-column flex-sm-row row-wrap" style={{backgroundColor:'#222831', color:'#EEEEEE'}}>
         <hr/>
         <div>
            <h4>Socials</h4>
            <a>Twitter</a>
            <a>GitHub</a>
            <a>LinkedIn</a>
         </div>
         <div>
            <h4>More</h4>
            <a>Know Christ</a>
            <a>Work with Me</a>
            <a>Request Resume</a>
         </div>
         <p className="w-100">&copy CodeEvolver</p>
      </div>
    );
  }
}

export { Footer }
